import React from 'react';
import {ContentLayout, LoaderHandler} from "@shared/ui";
import {userStore} from "@entities/user";

export const ProfilePage = () => {
    const user = userStore.useUser();

    return (
        <LoaderHandler isLoaded={!!user}>
            <ContentLayout>
                Профиль
            </ContentLayout>
        </LoaderHandler>
    );
};
